import React from 'react';
import './App.css';
import CreatureCard from './Components/CreatureCard'
import fish from './CreaturesJSON/CreaturesJSON';

function App() {
var creatureList = [...fish];

  return (
    <div className="App">
      <CreatureCard props={creatureList} />
    </div>
  );
}


export default App;
